%[text] # Analyze Expression Data
% Standard MATLAB initialization - ensure reproducibility
clear; clc; clf;
rng default;
warning('off', 'MATLAB:print:ContentTypeImageSuggested');
ver % display version information %[output:01e7e2ea]
% MATLAB Code Conventions
%  - local variable and function names begin with an uppercase letter to
%    distinquish them from those built into MATLAB
%  - functions use named parameters instead of positional parameters
%%
%[text] ## Structure the Raw Data
Data = ReadData(FileName="example.csv");
MeanData = CalculateMeanExpression(Data=Data);
%%
%[text] ## Verify Peak Time
PeakTime = FindTimeOfPeakExpression(MeanData=MeanData);
figure; PlotTimeCourse(MeanData=MeanData, PeakTime=PeakTime, TileParam="Signal1"); %[output:08622966]
figure; Figure1 = PlotTimeCourse(MeanData=MeanData, PeakTime=PeakTime, TileParam="Signal2"); %[output:3850c731]
SaveFigure(Figure=Figure1, FigureName="Figure1"); %[output:3850c731]
%%
%[text] ## Fit Models
% Use only the peak expression time for the model
PeakData = Data(Data.Time == PeakTime, :);
PeakData.Time = [];
%%
%[text] ### Single Signal Models
%[text] $E(S) = \\alpha\_0 + \\alpha\_i \\frac{\[S\_i\]}{\[S\_i\] + K\_i}\n$
% For simple estimates, we only need the mean value of expression across
% all replicates.
MeanPeakData = renamevars( ...
    groupsummary(PeakData, ["Signal1", "Signal2"], "mean", "Expression"), ...
    "mean_Expression", "Expression" ...
);

% Before fitting the model for real, calculate simple estimates of the
% model parameters. These estimates can serve as initial guesses for the
% actual model fitting algorithm, and they can provide a quick check on
% its results.
EstS1 = EstimateSingleSignal(MeanPeakData=MeanPeakData, Signal="Signal1");
EstS2 = EstimateSingleSignal(MeanPeakData=MeanPeakData, Signal="Signal2");

% With the estimates as initial guesses, fit models for each signal.
S1Params = FitSingleSignal(PeakData=PeakData, Signal="Signal1", InitialGuesses=EstS1);
S2Params = FitSingleSignal(PeakData=PeakData, Signal="Signal2", InitialGuesses=EstS2);

figure; PlotSingleSignal(PeakData=PeakData, Signal="Signal1", Params=S1Params); %[output:7b143086]
Figure2 = figure; PlotSingleSignal(PeakData=PeakData, Signal="Signal2", Params=S2Params); %[output:434c1b94]
SaveFigure(Figure=Figure2, FigureName="Figure2"); %[output:434c1b94]
%%
%[text] ### Multi-Signal Model
%[text] $E(S) = \\alpha\_0 + \\alpha\_1 \\frac{\[S\_1\]}{\[S\_1\] + K\_1} + \\alpha\_2 \\frac{\[S\_2\]}{\[S\_2\] + K\_2} + \\alpha\_{1,2} \\frac{\[S\_1\]\[S\_2\]}{(\[S\_1\] \[S\_2\] + {K\_{1,2}^2})}$
% As with single signal models, first calculate simple estimates for the
% parameter. Note that we use the computed model parameters for the single
% signal models, not the initial estimates, since the computed model is
% assumed to be more accurate.
EstModel = EstimateMultiSignal(MeanPeakData=MeanPeakData, EstS1=S1Params, EstS2=S2Params);

% Check estimates
Figure3 = figure; PlotMultiSignal( ... %[output:3374836e]
    Signal1Values=unique(MeanPeakData.Signal1), ... %[output:3374836e]
    Signal2Values=unique(MeanPeakData.Signal2), ... %[output:3374836e]
    Params=EstModel, ... %[output:3374836e]
    Observations=PeakData ... %[output:3374836e]
); %[output:3374836e]
SaveFigure(Figure=Figure3, FigureName="Figure3", Complex=true); %[output:3374836e]

Params = FitMultiSignal(PeakData=PeakData, InitialGuesses=EstModel);

figure; PlotMultiSignal( ... %[output:group:139f7ff8] %[output:169b8432]
    Signal1Values=unique(MeanPeakData.Signal1), ... %[output:169b8432]
    Signal2Values=unique(MeanPeakData.Signal2), ... %[output:169b8432]
    Params=Params, ... %[output:169b8432]
    Observations=PeakData ... %[output:169b8432]
); %[output:group:139f7ff8] %[output:169b8432]
%%
%[text] ### Dynamical Models
%[text] $\\frac{\\mathrm{d}S\_i}{\\mathrm{dt}} = \nc\_i E\_i(\\mathbf{S})\\cdot N - \n \\delta\_i \\cdot S\_i  -  \n m \\cdot S\_i$
Synthase1 = EstimateFullModel(FileName="example.csv");
Synthase2 = EstimateFullModel(FileName="example2.csv");

D1_D2 = 1.7;
C_D2 = [1.2652e-05, 2.5366e-05];
NRange = 0 : 0.005 : 1.0;
MRange = 0 : 0.025 : 5.0;

Columns = [
    ["Density",      "double"]; ... 
    ["MassTransfer", "double"]; ...
    ["Signal1Star",  "double"]; ...
    ["Signal2Star",  "double"]  ...
];
NMTable = table( ...
    'Size', [length(MRange) * length(NRange), height(Columns)], ...
    'VariableNames', Columns(:,1), ...
    'VariableTypes', Columns(:,2) ...
);

idx = 1;
for N = NRange
    S0 = [1, 1];
    for M = MRange
        SStar = Equilibrium(N=N, d1_d2=D1_D2, m_d2=M, c_d2=C_D2, Synthase1=Synthase1, Synthase2=Synthase2, S0=S0);
        NMTable.Density(idx) = N;
        NMTable.MassTransfer(idx) = M;
        NMTable.Signal1Star(idx) = SStar(1);
        NMTable.Signal2Star(idx) = SStar(2);
        idx = idx + 1;
        S0 = SStar;
    end
end

Figure4 = figure; PlotSignalHeatmap(Data=NMTable, Signal="Signal1"); %[output:1cc6348f]
SaveFigure(Figure=Figure4, FigureName="Figure4"); %[output:1cc6348f]

figure; PlotSignalHeatmap(Data=NMTable, Signal="Signal2"); %[output:8ad22ea1]

Effector = EstimateFullModel(FileName="effector.csv");
NMTable.Effector = Effector.ExpFn(NMTable.Signal1Star, NMTable.Signal2Star);

Figure5 = figure; PlotEffectorHeatmap(Data=NMTable); %[output:7ded7abd]
SaveFigure(Figure=Figure5, FigureName="Figure5"); %[output:7ded7abd]
%%
%[text] ## Additional Examples
%[text] ### Extended Peak Expression Time
LongPeak = EstimateFullModel(FileName="longpeak.csv");
Figure6 = figure; PlotMaxTimeCourse( ... %[output:1867439c]
    Data=LongPeak.Data, ... %[output:1867439c]
    MeanData=LongPeak.MeanData, ... %[output:1867439c]
    PeakTimes=[LongPeak.PeakTime - 1, LongPeak.PeakTime, LongPeak.PeakTime + 1]); %[output:1867439c]
SaveFigure(Figure=Figure6, FigureName="Figure6"); %[output:1867439c]
%%
%[text] ### Multi-Signal Response
Additive = EstimateFullModel(FileName="additive.csv");
Figure7 = tiledlayout(2, 2); %[output:78272759]

nexttile; CompareMultiSignal( ... %[output:78272759]
    Signal1Values=unique(Synthase1.MeanPeakData.Signal1), ... %[output:78272759]
    Signal2Values=unique(Synthase1.MeanPeakData.Signal2), ... %[output:78272759]
    Params=Synthase1.Params, ... %[output:78272759]
    Observations=Synthase1.PeakData, ... %[output:78272759]
    Tiled=2 ... %[output:78272759]
); %[output:78272759]
text(-0.15, 1.05, "A", FontWeight="bold", Units="normalized"); %[output:78272759]
nexttile; CompareMultiSignal( ... %[output:78272759]
    Signal1Values=unique(Additive.MeanPeakData.Signal1), ... %[output:78272759]
    Signal2Values=unique(Additive.MeanPeakData.Signal2), ... %[output:78272759]
    Params=Additive.Params, ... %[output:78272759]
    Observations=Additive.PeakData, ... %[output:78272759]
    Tiled=2 ... %[output:78272759]
); %[output:78272759]
text(-0.15, 1.05, "B", FontWeight="bold", Units="normalized"); %[output:78272759]
nexttile; CompareMultiSignal( ... %[output:78272759]
    Signal1Values=unique(Effector.MeanPeakData.Signal1), ... %[output:78272759]
    Signal2Values=unique(Effector.MeanPeakData.Signal2), ... %[output:78272759]
    Params=Effector.Params, ... %[output:78272759]
    Observations=Effector.PeakData, ... %[output:78272759]
    Tiled=2 ... %[output:78272759]
); %[output:78272759]
text(-0.15, 1.05, "C", FontWeight="bold", Units="normalized"); %[output:78272759]
nexttile; PlotMultiSignal( ... %[output:78272759]
    Signal1Values=unique(Effector.MeanPeakData.Signal1), ... %[output:78272759]
    Signal2Values=unique(Effector.MeanPeakData.Signal2), ... %[output:78272759]
    Params=Effector.Params, ... %[output:78272759]
    Observations=Effector.PeakData, ... %[output:78272759]
    Tiled=2 ... %[output:78272759]
); %[output:78272759]
text(-0.15, 1.05, "D", FontWeight="bold", Units="normalized"); %[output:78272759]
% Cleanup some of MATLAB's errors
Figure7.Children(1).Position = [0.8, 0.42, 0.1077, 0.0608]; %[output:78272759]
Figure7.Children(3).Position = [0.3, 0.42, 0.1491, 0.0608]; %[output:78272759]
Figure7.Children(5).Position = [0.75, 0.9, 0.1491, 0.0608]; %[output:78272759]
Figure7.Children(7).Position = [0.3, 0.9, 0.1491, 0.0608]; %[output:78272759]
Figure7.Children(2).FontSize = 5; %[output:78272759]
Figure7.Children(4).FontSize = 5; %[output:78272759]
Figure7.Children(6).FontSize = 5; %[output:78272759]
Figure7.Children(8).FontSize = 5; %[output:78272759]

SaveFigure(Figure=Figure7, FigureName="Figure7", Complex=true); %[output:78272759]
%%
%[text] ### Diverse Signals
NMTable2 = table( ...
    'Size', [length(MRange) * length(NRange), height(Columns)], ...
    'VariableNames', Columns(:,1), ...
    'VariableTypes', Columns(:,2) ...
);

idx = 1;
for N = NRange
    S0 = [1, 1];
    for M = MRange
        SStar = Equilibrium(N=N, d1_d2=4, m_d2=M, c_d2=C_D2, Synthase1=Synthase1, Synthase2=Synthase2, S0=S0);
        NMTable2.Density(idx) = N;
        NMTable2.MassTransfer(idx) = M;
        NMTable2.Signal1Star(idx) = SStar(1);
        NMTable2.Signal2Star(idx) = SStar(2);
        idx = idx + 1;
        S0 = SStar;
    end
end

NMTable2.Effector = Effector.ExpFn(NMTable2.Signal1Star, NMTable2.Signal2Star);

Figure8 = figure; PlotEffectorHeatmap(Data=NMTable2); %[output:9f4c814e]
SaveFigure(Figure=Figure8, FigureName="Figure8"); %[output:9f4c814e]
